INSERT INTO `static_page` VALUES (1,'Static Page 1','<p>das</p>',4,2),(2,'Static Page 2','<p>das</p>',4,1),(12,'About Us','<p><img style=\"width: 90%; display: block; margin-left: auto; margin-right: auto;\" src=\"/CapstoneProject/image/showimage/842\" /></p>\r\n<p style=\"text-align: center;\">\"I HAVE ALWAYS HAD SUCH A PASSION FOR BIG OPEN WAREHOUSES AND WOMENS CLOTHING. SO I PUT MY HEAD TO GOOD USE AND TRIED TO FIGURE OUT HOW I COULD WORK WITH BOTH OF THE THINGS THAT I AM MOST PASSIONATE ABOUT AND CAME UP WITH <em>PATS WAREHOUSE FOR WOMENS CLOTHING</em>.\" ~ Pat Toner</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"width: 300px; display: block; margin-left: auto; margin-right: auto;\" src=\"/CapstoneProject/image/showimage/851\" /></p>\r\n<p style=\"text-align: center;\">Patrick Toner</p>\r\n<p style=\"text-align: center;\">Owner</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Our Team:</p>\r\n<table style=\"width: 50%; display: block; margin-left: auto; margin-right: auto;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 350px;\">\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto; width: 300px; heigth: 300px;\" src=\"/CapstoneProject/image/showimage/843\" /></p>\r\n<p style=\"text-align: center;\">Chris S.</p>\r\n</td>\r\n<td style=\"width: 350px;\">\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto; width: 300px; heigth: 300px;\" src=\"/CapstoneProject/image/showimage/847\" /></p>\r\n<p style=\"text-align: center;\">Adam T.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 350px;\">\r\n<p><img style=\"width: 300px; heigth: 300px;\" src=\"/CapstoneProject/image/showimage/849\" /></p>\r\n<p style=\"text-align: center;\">Adam P.</p>\r\n</td>\r\n<td style=\"width: 350px;\">\r\n<p><img style=\"width: 300px; heigth: 300px;\" src=\"/CapstoneProject/image/showimage/850\" /></p>\r\n<p style=\"text-align: center;\">Chris S.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3007.865433261245!2d-81.52914304875968!3d41.0719340233519!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8830d63d2a6f15c5%3A0xfdfbb2c1164b5213!2sThe+Software+Guild!5e0!3m2!1sen!2sus!4v1466988468525\" width=\"600\" height=\"450\" frameborder=\"0\" align=\"center\" allowfullscreen=\"allowfullscreen\"></iframe></p>',282,3);
